import styled from 'styled-components'

export const StyledDetailPage = styled.div`
    height: 100vh; 
    display: flex; 
    flex-direction: column; 
    justify-content: center; 
    align-items: center; 

    div{
        background: green; 
        width: 100%; 
    }
`
